  `client_id` varchar(32) NOT NULL,
  `client_secret` varchar(255) NOT NULL COMMENT '密匙',
  `resource_ids` varchar(255) DEFAULT NULL COMMENT '所能访问的资源id集合,多个用逗号(,)分隔',
  `scope` varchar(255) DEFAULT NULL COMMENT '权限范围,多个用逗号(,)分隔',
  `authorized_grant_types` varchar(255) DEFAULT NULL COMMENT '客户端支持的grant_type, 可选值包括authorization_code,password,refresh_token,implicit,client_credentials, 若支持多个grant_type用逗号(,)分隔',
