  `refresh_token_validity` int DEFAULT NULL COMMENT 'refresh_token的有效时间值(单位:秒) 默认30天',
  `additional_information` varchar(4096) DEFAULT NULL COMMENT '预留的字段,可选,但若设置值,必须是JSON格式的数据',
  `autoapprove` varchar(255) DEFAULT NULL COMMENT '设置用户是否自动Approval操作 默认为false, 可选值包括true,false,read,write, 只适用于grant_type=authorization_code的情况',
  `create_by` varchar(20) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(20) DEFAULT NULL COMMENT '更新人',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`client_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

